import React from "react";
import logo from "../images/aranyagiri.png";

const Header = () =>
{
    return(
            <div className= "ui segment"
                 style={{border:"1px black solid"}}>
              
                    <img className="ui left floated medium image" src={logo} 
                         style={{ border:"1px black solid"}} alt="Header"/>
                    <h2 class="ui center aligned icon header"
                        style={{color:"red"}} >        
                            अरण्यगिरी फार्म हाऊस
                    </h2>           
                
            </div>
    );
};

export default Header;
